import React from 'react'


const Blog = ({blog, addLikes}) => {

  const consthandleLike = () => {
    addLikes({
      user: blog.user,
      title: blog.title,
      author: blog.author,
      url: blog.url,
      likes: blog.likes + 1
    },
    blog.id);
  }

  return (
  <div>
    {blog.title} {blog.author} {blog.url} {blog.likes} 
  </div>  
  )
  }

export default Blog
